import { makeStyles } from '@mui/styles';
import { borders } from '@mui/system';

export const useStyles = makeStyles({
    swap: {
        color: '#fff', 
        border: 2, 
        borderRadius: '50%', 
        borderColor: '#fff', 
        backgroundColor: '#000'
    },
    langBar: {
        backgroundColor: '#ABE3FF', 
        height: '10vh', 
        border: '1px solid', 
        borderRadius: '8px',
        borderColor: '#000'
    }
});
